/*
 * 14. 다음 결과를 출력하는 프로그램
 * 	11111
 * 	22222
 * 	33333
 * 	44444
 * 	55555
 */

public class 문제_06_반복문_14 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1;i<=5;i++)
		{
			for(int j=1;j<=5;j++)
			{
				System.out.print(i+" ");
			}
			System.out.println();
		}

	}

}
